import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import {
  FileText,
  Users,
  Calendar,
  CheckCircle,
  Clock,
  BarChart3,
  BookOpen,
  ClipboardList
} from 'lucide-react';
import { Button } from '../../components/UI/Button';
import { Card, CardContent, CardHeader, CardTitle } from '../../components/UI/Card';
import { toast } from 'react-hot-toast';
import studentApi from '../../services/studentApi';
import Progress from '../../components/UI/Progress';

// Import student components
import ViewInternshipDuration from '../../components/student/ViewInternshipDuration';
import ViewMentorEvaluation from '../../components/student/ViewMentorEvaluation';
import ViewTeacherEvaluation from '../../components/student/ViewTeacherEvaluation';
import PreliminaryReportCheck from '../../components/student/PreliminaryReportCheck';

const StudentDashboard = () => {
  const [dashboardData, setDashboardData] = useState({
    reportsSubmitted: 0,
    daysRemaining: 0,
    overallProgress: 0,
    recentActivity: []
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        const overview = await studentApi.dashboard.getOverview();
        const stats = await studentApi.dashboard.getStats();
        const activities = await studentApi.dashboard.getActivities();

        setDashboardData({
          ...overview,
          ...stats,
          recentActivity: activities
        });
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
        toast.error('Failed to load dashboard data');
      } finally {
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-emerald-500"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Welcome Section */}
      <div className="bg-white rounded-lg shadow-sm p-6">
        <h1 className="text-2xl font-bold text-gray-900">Welcome back, Student</h1>
        <p className="mt-1 text-sm text-gray-500">Track your internship progress and tasks</p>
      </div>

      {/* Quick Actions */}
      <div className="grid gap-6 md:grid-cols-2 lg:grid-cols-3">
        <Card className="hover:shadow-md transition-shadow">
          <CardContent className="p-6">
            <div className="flex items-center justify-between">
              <div>
                <div className="w-12 h-12 rounded-lg bg-blue-100 flex items-center justify-center mb-4">
                  <FileText className="h-6 w-6 text-blue-600" />
                </div>
                <h3 className="font-medium text-gray-900">Submit Report</h3>
                <p className="text-sm text-gray-500 mt-1">Upload your weekly or monthly report</p>
              </div>
              <Button
                variant="outline"
                as={Link}
                to="/dashboard/reports"
                className="text-blue-600"
              >
                Submit
              </Button>
            </div>
          </CardContent>
        </Card>

        <Card className="hover:shadow-md transition-shadow">
          <CardContent className="p-6">
            <div className="flex items-center justify-between">
              <div>
                <div className="w-12 h-12 rounded-lg bg-emerald-100 flex items-center justify-center mb-4">
                  <BookOpen className="h-6 w-6 text-emerald-600" />
                </div>
                <h3 className="font-medium text-gray-900">Register Internship</h3>
                <p className="text-sm text-gray-500 mt-1">Register for a new internship position</p>
              </div>
              <Button
                variant="outline"
                as={Link}
                to="/dashboard/internship"
                className="text-emerald-600"
              >
                Register
              </Button>
            </div>
          </CardContent>
        </Card>

        <Card className="hover:shadow-md transition-shadow">
          <CardContent className="p-6">
            <div className="flex items-center justify-between">
              <div>
                <div className="w-12 h-12 rounded-lg bg-purple-100 flex items-center justify-center mb-4">
                  <ClipboardList className="h-6 w-6 text-purple-600" />
                </div>
                <h3 className="font-medium text-gray-900">Preliminary Check</h3>
                <p className="text-sm text-gray-500 mt-1">Submit preliminary report check</p>
              </div>
              <Button
                variant="outline"
                className="text-purple-600"
                onClick={() => document.getElementById('preliminary-check').scrollIntoView({ behavior: 'smooth' })}
              >
                Check
              </Button>
            </div>
          </CardContent>
        </Card>
      </div>

      {/* Progress and Duration */}
      <div className="grid gap-6 md:grid-cols-2">
        {/* Internship Duration */}
        <ViewInternshipDuration />

        {/* Progress Section */}
        <Card>
          <CardHeader>
            <CardTitle>Overall Progress</CardTitle>
          </CardHeader>
          <CardContent>
            <div className="space-y-6">
              <div>
                <div className="flex justify-between text-sm mb-2">
                  <span className="text-gray-500">Completion</span>
                  <span className="font-medium">{dashboardData.overallProgress}%</span>
                </div>
                <Progress value={dashboardData.overallProgress} color="emerald" size="lg" />
              </div>
            </div>
          </CardContent>
        </Card>
      </div>

      {/* Evaluations */}
      <div className="grid gap-6 md:grid-cols-2">
        <ViewMentorEvaluation />
        <ViewTeacherEvaluation />
      </div>

      {/* Preliminary Report Check */}
      <div id="preliminary-check">
        <PreliminaryReportCheck />
      </div>

      {/* Recent Activity */}
      {dashboardData.recentActivity.length > 0 && (
        <Card>
          <CardHeader>
            <CardTitle>Recent Activity</CardTitle>
          </CardHeader>
          <CardContent>
            <div className="space-y-4">
              {dashboardData.recentActivity.map((activity, index) => (
                <div key={index} className="flex items-center space-x-4">
                  <div className={`p-2 rounded-full bg-${activity.type === 'report' ? 'blue' : 'emerald'}-100`}>
                    {activity.type === 'report' ? (
                      <FileText className={`h-5 w-5 text-${activity.type === 'report' ? 'blue' : 'emerald'}-600`} />
                    ) : (
                      <CheckCircle className={`h-5 w-5 text-${activity.type === 'report' ? 'blue' : 'emerald'}-600`} />
                    )}
                  </div>
                  <div className="flex-1">
                    <p className="text-sm font-medium text-gray-900">{activity.title}</p>
                    <p className="text-sm text-gray-500">{activity.description}</p>
                  </div>
                  <span className="text-sm text-gray-500">
                    {new Date(activity.timestamp).toLocaleDateString()}
                  </span>
                </div>
              ))}
            </div>
          </CardContent>
        </Card>
      )}
    </div>
  );
};

export default StudentDashboard;
